import React from "react";
import HeaderComponent from "../Headers/HeaderComponent";
import hotel from '../../images/hotel.jpg'
import flights from '../../images/flight.jpg'
import currency from '../../images/currency.jpg'
import {Carousal} from "./Carousal";
import {fetchProfile} from "../../services/services";

export default class UserDashboardComponent extends React.Component {

  state = {
    user: {
      email: '',
      first: '',
      last: '',
      type: '',
      ticketsBooked: []
    },
    login: false
  };

  componentDidMount() {
    fetchProfile().then(user => {
      if (user) {
        this.setState({
          user: user,
          login: true
        })
      }
    })
  }

  render() {
    return (
        <>
          <HeaderComponent
              user={this.state.user}
              login={this.state.login}
              history={this.props.history}
          />
          <div className='container container-background'>
            <div className='row'>
              <Carousal/>
            </div>
            <div className='row mt-3 pb-3'>
              <div className='col-md-4 col-sm-12 mb-3'>
                <div className="card">
                  <img className="card-img-top" src={flights}
                       alt="Card image cap"/>
                  <div className="card-body">
                    <h5 className="card-title">Book Flights</h5>
                    <p className="card-text">Some quick example text to build
                      on the card title and make up the bulk of the card's
                      content.</p>
                    <button className="btn btn-primary" onClick={()=>this.props.history.push('/search')}>Go
                      somewhere</button>
                  </div>
                </div>
              </div>
              <div className='col-md-4 col-sm-12 mb-3'>
                <div className="card">
                  <img className="card-img-top" src={hotel}
                       alt="Card image cap"/>
                  <div className="card-body">
                    <h5 className="card-title">Search Hotels</h5>
                    <p className="card-text">Some quick example text to build
                      on the card title and make up the bulk of the card's
                      content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                  </div>
                </div>
              </div>
              <div className='col-md-4 col-sm-12 mb-3'>
                <div className="card">
                  <img className="card-img-top" src={currency}
                       alt="Card image cap"/>
                  <div className="card-body">
                    <h5 className="card-title">Current Rates</h5>
                    <p className="card-text">Some quick example text to build
                      on the card title and make up the bulk of the card's
                      content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </>
    )
  }
}
